import React from 'react';
import Header from './Header';
import '../CSS/Users.css'

const Users = ({ toggleSidebar }) => {
  return (
    <React.Fragment>
      <Header toggleSidebar={toggleSidebar} heading="Users" />
      <main>Users</main>
    </React.Fragment>
  );
};

export default Users;
